import React, { Component } from 'react'
import './App.css';
class SearchProject extends Component {
    constructor(props) {
        super(props)
        this.state = {
             display: ""
        }
    }
    textChange= () =>{
        this.setState()
    }
    render() {
        let curr= this.state;
        return (
            <div>
                <label>Search by project</label>
                <input type= "text" onChange={this.textChange} value={curr.display}/>
            </div>
        )
    }
}

export default SearchProject
